@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_16 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multifocal_dystonia ;
    :has_definition "A multifocal dystonia that is characterized by early-onset progressive limb dystonia, laryngeal and oromandibular dystonia, and parkinsonism, and that has_material_basis_in autosomal recessive inheritance of homozygous mutation in the protein activator of interferon induced protein kinase EIF2AK2 (PRKRA) gene on chromosome 2q31." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paroxysmal_nonkinesigenic_dyskinesia_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by attacks of dystonic or choreathetotic movements precipitated by stress, fatigue, coffee or alcohol intake or menstruation, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the PNKD metallo-beta-lactamase domain containing gene on chromosome 2q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_27 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :segmental_dystonia ;
    :has_definition "A segmental dystonia characterized by autosomal recessive inheritance of segmental isolated dystonia mainly affecting the craniocervical region and upper limbs with onset in the first 2 decades of life that has_material_basis_in autosomal recessive inheritance of compound heterozygous mutation in the collagen type VI alpha-3 gene on chromosome 2q37." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_23 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :focal_dystonia ;
    :has_definition "A focal dystonia characterized by adult-onset cervical dystonia typically in the fourth or fifth decade of life that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the CACNA1B gene on chromosome 9q34." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_24 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :focal_dystonia ;
    :has_definition "A focal dystonia that is characterized by focal dystonia affecting the neck, laryngeal muscles, and muscles of the upper limbs, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the anoctamin 3 (ANO3) gene on chromosome 11p14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:episodic_kinesigenic_dyskinesia_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia characterized by recurrent brief involuntary hyperkinesias triggered by sudden movements that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the proline-rich transmembrane protein 2 gene (PRRT2) on chromosome 16p11." ;
    :has_exact_synonym "Paroxysmal kinesigenic choreoathetosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:episodic_kinesigenic_dyskinesia_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by recurrent brief involuntary hyperkinesias triggered by sudden movements that has_material_basis_in autosomal dominant inheritance of variation in the chromosome region 16q13-q22.1." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_25 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :multifocal_dystonia ;
    :has_definition "A multifocal dystonia that is characterized by cervical, laryngeal and hand-forearm dystonia, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the GNAL gene on chromosome 18p11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_12 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by asymmetric dystonia and parkinsonism with abrupt onset in young adulthood that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the gene encoding the alpha-3 subunit of the N,K-ATPase (ATP1A3) on chromosome 19q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_dystonia_parkinsonism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :focal_dystonia,
        :x_linked_recessive_disease ;
    :has_definition "A focal dystonia that is characterized by parkinsonism that is frequently accompanied by focal dystonia and progresses to generalized dystonia that has_material_basis_in X-linked recessive inheritance of SVA retrotransposon insertion in the intron of the TATA-box binding protein associated factor 1 gene (TAF1) on chromosome Xq13.1." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_with_onset_in_infancy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :generalized_dystonia ;
    :has_definition "A generalized dystonia that is characterized by autosomal dominant inheritance of generalized dystonia with severe involvement of the legs, mild involvement of the face and arms, and onset in infancy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:enhanced_s_cone_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :retinal_disease ;
    :has_definition "A retinal disease that is characterized by early onset night blindness, hypersensitivity to blue light, and in some cases a more general retinal degeneration that has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the nuclear receptor subfamily 2 group E member 3 gene (NR2E3) on chromosome 15q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wolcott_rallison_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatic_dysfunction ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by permanent neonatal diabetes mellitus with multiple epiphyseal dysplasia, osteoporosis, growth retardation and frequently hepatic and renal dysfunction that has_material_basis_in homozygous mutation in the eukaryotic translation initiation factor 2 alpha kinase 3 (EIF2AK3) gene on chromosome 2p11.2." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_cold_autoinflammatory_syndrome rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by recurrent episodes of maculopapular skin rash triggered by exposure to cold associated with low-grade fever, general malaise, eye redness and arthralgia/myalgia." ;
    :has_exact_synonym "FCAS" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_cold_autoinflammatory_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :familial_cold_autoinflammatory_syndrome ;
    :has_definition "A familial cold autoinflammatory syndrome characterized by autosomal dominant inheritance that has_material_basis_in heterozygous mutation in the NLRP gene on chromosome 1q44." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_cold_autoinflammatory_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :familial_cold_autoinflammatory_syndrome ;
    :has_definition "A familial cold autoinflammatory syndrome characterized by autosomal dominant inheritance that has_material_basis_in heterozygous mutation in the NLRP12 gene on chromosome 19q13." ;
    :has_exact_synonym "NLRP12-associated hereditary periodic fever syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_cold_autoinflammatory_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :familial_cold_autoinflammatory_syndrome ;
    :has_definition "A familial cold autoinflammatory syndrome characterized by autosomal dominant inheritance of development of cutaneous urticaria, erythema and pruritus in response to cold exposure with. FCAS3 has_material_basis_in heterozygous deletion within the PLCG2 gene on chromosome 16q." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_cold_autoinflammatory_syndrome_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :familial_cold_autoinflammatory_syndrome ;
    :has_definition "A familial cold autoinflammatory syndrome that is characterized by episodic high fevers, urticaria-like rash, and arthralgias starting at 2-3 months of age and often induced by cold-exposure that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the NLRC4 gene on chromosome 2p22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_like_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome characterized by pancytopenia, immune deficiency and cutaneous malignancies." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fuhrmann_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :bone_development_disease ;
    :has_definition "A bone development disease that is characterized by bowing of the femora, aplasia or hypoplasia of the fibulae and poly-, oligo-, and syndactyly that has_material_basis_in autosomal recessive inheritance of homozygous mutation in the Wnt family member 7A (WNT7A) gene on chromosome 3p25." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:giant_axonal_neuropathy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :axonal_neuropathy ;
    :has_definition "An axonal neuopathy that is characterized by progressive motor and sensitive peripheral, central nervous system neuropathy, with axonal loss and giant axonal swellings filled with neurofilaments, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the gigaxonin (GAN) gene on chromosome 16q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:giant_axonal_neuropathy_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_dominant_disease,
        :axonal_neuropathy ;
    :has_definition "An axonal neuopathy that is characterized by distal sensory impairment, lower extremity muscle weakness and atrophy, and giant axonal swelling with neurofilament accumulation, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the DDB1- and CUL4-associated factor 8 (DCAF8) gene on chromosome 1q23." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypogonadotropic_hypogonadism rdfs:subClassOf :hypogonadism ;
    :has_definition "A hypogonadism characterized by a impaired signalling by gonadotrpin relasing hormone." ;
    :has_exact_synonym "hypogonadotropism",
        "congenital idiopathic hypogonadotropic hypogonadism"@en,
        "isolated congenital gonadotropin deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypogonadotropic_hypogonadism_11_with_or_without_anosmia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in homozygous mutation in the TACR3 gene on chromosome 4q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypogonadotropic_hypogonadism_12_with_or_without_anosmia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in homozygous mutation in the GNRH1 gene on chromosome 8p21." ;
    :has_exact_synonym "familial hypogonadotrophic eunuchoidism"@en,
        "familial idiopathic gonadotrpin deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

