            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in mutation in the HS6ST1 gene on chromosome 2q14, sometimes in association with mutations in other genes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

