        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in heterozygous mutation in the SPRY4 gene on chromosome 5q31, sometimes in association with mutations in other genes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
