        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in mutation in the SEMA3A gene on chromosome 7, sometimes in association with mutations in other genes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
