        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that has_material_basis_in heterozygous mutation in the FGFR1 gene on chromosome 8p11, sometimes in association with mutation in other genes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
