            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hypogonadotropic_hypogonadism ;
    :has_definition "A hypogonadotropic hypogonadism that is characterized by autosomal dominant inheritance and has_material_basis_in heterozygous mutation in the NELF gene on chromosome 9q34, sometimes in association with mutation in another gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
