        :tetrahydrobiopterin_bh4_deficient_hyperphenylalaninemia ;
    :has_definition "A tetrahydrobiopterin (BH4)-deficient hyperphenylalaninemia that is characterized by hyperphenylalaninemia, depletion of the neurotransmitters dopamine and serotonin, and progressive cognitive and motor deficits that has_material_basis_in autosomal recessive inheritance of mutation in the gene encoding 6-pyruvoyl-tetrahydropterin synthase (PTS) on chromosome 11q23.1." ;
    :has_exact_synonym "6-pyruvoyl-tetrahydropterin synthase deficiency"@en,
