        "thiamine-responsive megaloblastic anaemia syndrome"@en,
        "thiamine-responsive megaloblastic anaemia with diabetes mellitus and sensorineural deafness"@en,
        "thiamine-responsive megaloblastic anemia with diabetes mellitus and sensorineural deafness"@en,
        "thiamine-responsive myelodysplasia"@en .

